import React, { Component } from 'react';

class Coin extends Component {
  constructor(props) {
    super(props);
  }

  render() {
    const { flip, count, heads, tails, headCoin, tailCoin } = this.props.vals;

    console.log(headCoin);

    return (
      <div>
        <img alt="" src={headCoin} />
        <p>
          Out of {count} flips, there have been {heads} heads and {tails} tails{' '}
        </p>
      </div>
    );
  }
}

export default Coin;
